import React from "react"
import "./Homepage.css"
import Navigation from "../../component/Navigation"



function Homepage() {
    return (
        <div>
            <Navigation />
            <img src="https://res.cloudinary.com/dtbjhs8a6/image/upload/v1575979267/xg157iczn39aviwt43zp.jpg" alt="image" width="1600" height="600" />

            <input type="submit" placeholder="Sign in as a Volunteer" />
        </div>
    )
}


export default Homepage
